"use strict";

function findContestMatch(n) {
    let team = Array.from({length: n}, (_, i) => (i + 1).toString());
    while (n > 1) {
        for (let i = 0; i < (n >> 1); i++) {
            team[i] = `(${team[i]},${team[n - 1 - i]})`;
        }
        n >>= 1;
    }
    return team[0];
}

function f_gold(n) {
    return findContestMatch(n);
}
